import { QueryClient, QueryClientProvider, useQueryClient } from 'react-query';
import './App.css';
import ReactHookForm from './Components/ReactHookForm';

function App() {
  const queryClient = useQueryClient(); 
  return (
    <QueryClientProvider client={queryClient}>
      <ReactHookForm />
    </QueryClientProvider>
  );
}

export default App;
